import React from 'react';

const ProfileScreen: React.FC = () => {
  return (
    <div className="px-4 flex flex-col items-center justify-center h-full">
      <div className="w-20 h-20 rounded-full bg-gradient-to-r from-[#FF2E63] to-[#00F5FF] flex items-center justify-center mb-4">
        <i className="fas fa-user text-3xl"></i>
      </div>
      <h2 className="text-xl font-bold mb-2">Profile</h2>
      <p className="text-white/60 text-center">Profile functionality coming soon!</p>
    </div>
  );
};

export default ProfileScreen;
